  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0116707 includes chemical,
  discrete sample, physical and profile data collected from NEW HORIZON in the North
  Pacific Ocean from 1980-08-10 to 1980-09-03 and retrieved during cruise P16N_1980_FIONA.
  These data include DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, PHOSPHATE, Potential
  temperature (theta), SALINITY, SILICATE and WATER TEMPERATURE. The instruments used
  to collect these data include CTD and bottle. These data were collected by T. Hayward
  of Unknown as part of the P16N_1980_FIONA data set.nnThe International CLIVAR Global
  Ocean Carbon and Repeat Hydrography Program carries out a systematic and global
  re-occupation of select WOCE/JGOFS hydrographic sections to quantify changes in
  storage and transport of heat, fresh water, carbon dioxide (CO2), and related parameters.\",\n\t\"owner_org\":
